import React from 'react';
import {withRouter} from 'react-router-dom'
import '../styles/App.css'

function clickHandler(event){
    let path = '/'

}

class Lawlist extends React.Component(){
    constructor(props){
        super(props)
        this.clickHandler = this.clickHandler.bind(this)
    }
    clickHandler(event){
        let path = '/'
        this.props.history.push(path)
    }
    render(){
        return(
            <center>
                <div classname="btn-group btn-matrix">
                    <button type="button" className="btn btn-default" value="ekaLaki" onClick={clickHandler}>Eka Laki</button>
                    <button type="button" className="btn btn-default" value="tokaLaki" onClick={clickHandler}>Toka laki</button>
                    <button type="button" className="btn btn-default" value="kolLaki" onClick={clickHandler}>Kolmas laki</button>
                    <button type="button" className="btn btn-default" value="nelLaki" onClick={clickHandler}>Neljäs laki</button>
                    <button type="button" className="btn btn-default" value="viiLaki" onClick={clickHandler}>Viides laki</button>
                    <button type="button" className="btn btn-default" value="kuuLaki" onClick={clickHandler}>Kuudes laki</button>
                    <button type="button" className="btn btn-default" value="seiLaki" onClick={clickHandler}>Seitsemäs laki</button>
                    <button type="button" className="btn btn-default" value="kasLaki" onClick={clickHandler}>Kahdeksas laki</button>
                    <button type="button" className="btn btn-default" value="ysiLaki" onClick={clickHandler}>Yhdeksäs laki</button>
                </div>
                <div>
                    <center><button className="btn btn-primary mt-3 mb-3">Select</button></center>
                </div>
            </center>
        )
    }
}

export default withRouter(Lawlist)
